let axiosFunc=()=>{const options={params:{link:"lins"}};axios.get("http://localhost/expressYaSelf/db/links.php",options).then(response=>{const data=response.data[0],nav=document.querySelector("#main-nav");console.log(data);let output="";data.forEach(element=>{output+=`<a class="p-2" class="text-faded" href="http://localhost/php-forum/${element.link.toLowerCase()}">${element.link}</a>`}),console.log(nav)}).catch(err=>{console.log(err)}).then(function(){})};